import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";
import Papa from "papaparse";

// Fix default marker icons
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require("leaflet/dist/images/marker-icon-2x.png"),
  iconUrl: require("leaflet/dist/images/marker-icon.png"),
  shadowUrl: require("leaflet/dist/images/marker-shadow.png"),
});

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function MapPage() {
  const [spots, setSpots] = useState([]);
  const [selectedSpot, setSelectedSpot] = useState(null);

  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng)
              .map((r) => ({
                name: r.name,
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                description: r.description || "No description available",
                visitors: r.visitors || "Moderate",
                tags: r.tags ? r.tags.split(",").map((t) => t.trim()) : [],
                image: r.image
                  ? `/images/${r.image.replace(/^\/+/, "").split("/").pop()}`
                  : null,
              }));
            setSpots(rows);
          },
        });
      });
  }, []);

  return (
    <div style={{ display: "flex", height: "85vh", width: "100%" }}>
      {/* Map */}
      <div style={{ flex: 1 }}>
        <MapContainer
          center={CENTER}
          zoom={13}
          style={{ height: "100%", width: "100%" }}
        >
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {spots.map((spot, i) => (
            <Marker
              key={i}
              position={[spot.lat, spot.lng]}
              eventHandlers={{ click: () => setSelectedSpot(spot) }}
            />
          ))}
        </MapContainer>
      </div>

      {/* Info Panel */}
      {selectedSpot && (
        <div
          style={{
            width: "38%",
            background: "#fff",
            padding: "20px",
            overflowY: "auto",
            borderLeft: "2px solid #e5e7eb",
            boxShadow: "-3px 0 8px rgba(0,0,0,0.1)",
            animation: "fadeIn 0.3s ease-in-out",
          }}
        >
          {/* Close Button */}
          <button
            onClick={() => setSelectedSpot(null)}
            style={{
              float: "right",
              background: "#ef4444",
              color: "white",
              border: "none",
              borderRadius: "6px",
              padding: "4px 10px",
              cursor: "pointer",
              fontWeight: "bold",
            }}
          >
            âœ–
          </button>

          {/* Image */}
          {selectedSpot.image && (
            <img
              src={selectedSpot.image}
              alt={selectedSpot.name}
              style={{
                width: "100%",
                height: "180px",
                objectFit: "cover",
                borderRadius: "10px",
                marginBottom: "15px",
                transition: "transform 0.3s ease",
                boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
              }}
              onMouseOver={(e) => (e.currentTarget.style.transform = "scale(1.02)")}
              onMouseOut={(e) => (e.currentTarget.style.transform = "scale(1)")}
            />
          )}

          {/* Name */}
          <h2
            style={{
              fontSize: "1.6rem",
              fontWeight: "700",
              marginBottom: "8px",
              color: "#1f2937",
            }}
          >
            {selectedSpot.name}
          </h2>

          {/* Visitors */}
          <p style={{ fontSize: "0.95rem", color: "#374151", marginBottom: "10px" }}>
            <strong>Visitors:</strong> {selectedSpot.visitors}
          </p>

          {/* Description */}
          <p style={{ fontSize: "0.95rem", color: "#4b5563", lineHeight: "1.6" }}>
            {selectedSpot.description}
          </p>

          {/* Tags */}
          {selectedSpot.tags.length > 0 && (
            <p
              style={{
                marginTop: "12px",
                padding: "8px",
                background: "#f3f4f6",
                borderRadius: "6px",
                fontSize: "0.9rem",
                color: "#374151",
              }}
            >
              <strong>Tags:</strong> {selectedSpot.tags.join(", ")}
            </p>
          )}
        </div>
      )}

      {/* Fade-in keyframes */}
      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateX(20px); }
            to { opacity: 1; transform: translateX(0); }
          }
        `}
      </style>
    </div>
  );
}
